import React, { Component } from 'react';

class Resume extends Component {
  render() {
    return (
      <div id='resume'>
        <div id='title'>Resume</div>
        <div className='container d-md-flex'>
          <div className='col-md-6'>
            <div className='title_2'>Education</div>
            <div className='border-5 border-info border-start ps-3'>
              <div Education>
                <div>Licence professionnelle</div>
                <div>instrumentation et système</div>
                <div>Ecole supérieur de technologie, Guelmim</div>
                <div>2019 – 2020</div>
              </div>
            </div>
          </div>
          <div className='col-md-6 bg-danger d-none'>
            <div className='title_2'>Professional Experience</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Resume;
